import TodoListItem from "./todo-list-item";

const items = ["Drink coffe", "Build Awesome App"];

const TodoList = () => {
  return (
    <ul>
      <li>
        <TodoListItem label="Drink coffe" />
      </li>
      <li>
        <TodoListItem label="Drink vodka" important />
      </li>
    </ul>
  );
};

export default TodoList;
